import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Bloodborne Wiki</h1>
      </header>
      <div className="content">
        <div className="links">
          <a href="#">Armor</a>
          <a href="#">Caryll Runes</a>
          <a href="#">Hunter Tools</a>
          <a href="#">Weapons</a>
        </div>
      </div>
    </div>
  );
}

export default App;
